INSERT INTO `posts` VALUES (2,'aaxxxx','aa','<p>aaaaaaaaaaaaaaaaa</p>','posts/UEYPxBS5hJmJ1wSL0hdvqwebwsp5M63hVINQX29t.jpg',1,44,17,NULL,'2022-08-28 20:52:09','2022-08-28 22:45:29'),(3,'tuần mới vui vẻ','tuan-moi-vui-ve','<p>ch&uacute;c to&agrave;n thể c&ocirc;ng ty tuần mới trần đầy năng lượng</p>','posts/FSBaEw1Q3rg1CAGp2e1LDivypceejua4cXIMZFW8.png',1,12,17,NULL,'2022-08-28 22:28:35','2022-08-28 22:46:34'),(4,'không có gì cả','khong-co-gi-ca','<p>Xjcvjfjdjdj</p>','posts/SviB9V0enbPEFAals7B212HFPliIe9SNJ8Z09fJQ.jpg',1,NULL,17,NULL,'2022-08-28 22:28:43','2022-08-28 22:28:43'),(5,'Trần tiến','tran-tien','<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div><a href=\"https://tinhte.vn/profile/minhtrind.252123/\"><br>MinhTriND</a>\r\n<div><button>+ Theo d&otilde;i</button></div>\r\n</div>\r\n<div>13 ng&agrave;yB&igrave;nh luận:&nbsp;17</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<div>\r\n<div>\r\n<div tabindex=\"0\" title=\"\" role=\"button\" aria-label=\"animation\">&nbsp;</div>\r\n</div>\r\n</div>\r\n<div><button>Th&ocirc;ng b&aacute;o</button></div>\r\n</div>\r\n</div>\r\n<div>\r\n<div>\r\n<p>Xem nhanh</p>\r\n<button>Ẩn</button></div>\r\n<div>\r\n<p>1. Hệ thống tiện nghi (điều ho&agrave;, hiển thị, &acirc;m thanh) tr&ecirc;n xe thật sự kh&ocirc;ng tốn qu&aacute; nhiều điện</p>\r\n<p>2. Nhiệt độ m&ocirc;i trường l&agrave; yếu tố rất quan trọng</p>\r\n<p>3. Xe di chuyển chậm &iacute;t tốn pin hơn v&agrave; hệ thống phanh t&aacute;i sinh kh&ocirc;ng phải v&ocirc; dụng</p>\r\n<p>4. C&aacute;c yếu tố kh&aacute;c</p>\r\n</div>\r\n</div>\r\n<div><img style=\"height: auto; width: 754px;\" src=\"https://photo2.tinhte.vn/data/attachment-files/2022/08/6089285_Cover-Pham-vi-xe-dien-tinhte.jpg\" alt=\"Sự thật về c&aacute;c yếu tố c&oacute; thể ảnh hưởng đến phạm vi hoạt động của xe điện\"></div>\r\n<div>&nbsp;</div>\r\n<article>\r\n<div>\r\n<div>\r\n<div>\r\n<div data-author=\"MinhTriND\">Kh&aacute;c với xe d&ugrave;ng động cơ đốt trong truyền thống, nhiều yếu tố ảnh hưởng đến&nbsp;<a href=\"https://tinhte.vn/tag/pham-vi-hoat-dong-cua-xe-dien\">phạm vi hoạt động của xe điện</a>&nbsp;hơn. V&agrave; cũng ch&iacute;nh bởi điều n&agrave;y, rất nhiều th&ocirc;ng tin xuất hiện tr&ecirc;n mạng cho thấy những &ldquo;rủi ro&rdquo; m&agrave; người d&ugrave;ng&nbsp;<a href=\"https://tinhte.vn/tag/xe-dien\">xe điện</a>&nbsp;c&oacute; thể gặp phải khi vận h&agrave;nh xe trong c&aacute;c điều kiện giao th&ocirc;ng, thời tiết,&hellip;kh&aacute;c nhau.<br><br>Mặc d&ugrave; chỉ mới được phổ biến ở Việt Nam trong v&ograve;ng 1-2 năm trở lại đ&acirc;y, thế nhưng loại xe n&agrave;y đ&atilde; v&agrave; đang được sử dụng từ h&agrave;ng chục năm qua ở một số nước. V&igrave; vậy, kh&ocirc;ng phải l&agrave; kh&ocirc;ng c&oacute; cơ sở dữ liệu để t&igrave;m hiểu xem những yếu tố n&agrave;o ảnh hưởng đến phạm vi hoạt động của xe điện v&agrave; mức độ nghi&ecirc;m trọng của ch&uacute;ng như thế n&agrave;o.<br><br>\r\n<h2 id=\"menuid0\"><strong>1. Hệ thống tiện nghi (điều ho&agrave;, hiển thị, &acirc;m thanh) tr&ecirc;n xe thật sự kh&ocirc;ng tốn qu&aacute; nhiều điện</strong></h2>\r\n<br><img src=\"https://photo2.tinhte.vn/data/attachment-files/2022/08/6089281_Pham-vi-xe-dien-tinhte-7.jpg\" alt=\"[​IMG]\" data-url=\"https://photo2.tinhte.vn/data/attachment-files/2022/08/6089281_Pham-vi-xe-dien-tinhte-7.jpg\"><br><br>M&igrave;nh mượn được 1 chiếc xe điện, trong 1 b&agrave;i test nhỏ, xe di chuyển ở qu&atilde;ng đường chỉ tầm 500 m&eacute;t nhưng tốn 30 ph&uacute;t. Nửa tiếng ngồi tr&ecirc;n xe với c&aacute;c hệ thống điều ho&agrave;, giải tr&iacute; hoạt động gần hết c&ocirc;ng suất, v&agrave; pin tụt 3%, tương ứng với qu&atilde;ng đường hơn 6,5 km nếu di chuyển trong điều kiện thuận lợi. T&iacute;nh to&aacute;n nhanh, nếu pin xe đầy 100%, n&oacute; đủ cung cấp cho c&aacute;c hệ thống cần năng lượng tr&ecirc;n xe li&ecirc;n tục hơn 17 tiếng. Nếu đường kẹt 17 tiếng như vậy, c&oacute; lẽ bản th&acirc;n bạn đ&atilde; gặp c&aacute;c vấn đề kh&aacute;c trước khi chiếc xe gặp vấn đề l&agrave; hết pin.</div>\r\n</div>\r\n<div>\r\n<div data-author=\"MinhTriND\"><br>Trước đ&acirc;y, trang which.co.uk c&oacute; l&agrave;m 1 b&agrave;i thử nghiệm nhanh li&ecirc;n quan tới vấn đề n&agrave;y. Họ d&ugrave;ng 1 chiếc VW ID.4 với pin 77kWh, sau đ&oacute; m&ocirc; phỏng như xe trong t&igrave;nh huống kẹt đường, đứng y&ecirc;n tại chỗ. L&uacute;c n&agrave;y, họ mở nhạc qua Android Auto, bật hệ thống sưởi 2 ghế trước ở mức cao nhất, bật điều ho&agrave;, mở hệ thống chiếu s&aacute;ng, sạc 1 c&aacute;i tablet qua cổng USB. Kết quả, pin của xe hao hụt 2% sau thời gian 1 tiếng 15 ph&uacute;t. Thời lượng pin n&agrave;y thường cung cấp cho VW ID.4 một qu&atilde;ng di chuyển tầm 12,8 km.<br><br>Để so s&aacute;nh, pin m&agrave; chiếc xe m&igrave;nh sử dụng để thử c&oacute; dung lượng 42kWh. 30 ph&uacute;t, tốn 3% nghĩa l&agrave; tốn 1,26 kWh, 1 tiếng th&igrave; tốn 2,52 kWh. Trong khi đ&oacute;, VW ID.4 trong hơn 1 tiếng tốn 1,54 kWh. Do xe của m&igrave;nh kh&ocirc;ng đứng y&ecirc;n 1 chỗ trong qu&aacute; tr&igrave;nh thử nghiệm, n&ecirc;n c&oacute; vẻ l&agrave; hao pin hơn. Ngo&agrave;i ra, cũng c&ograve;n nhiều thứ ảnh hưởng, về c&ocirc;ng nghệ quản l&yacute; pin, phần mềm n&agrave;y kia của từng h&atilde;ng xe nữa.<br><br>Nh&igrave;n chung, hầu hết c&aacute;c b&agrave;i thử nghiệm đều c&ocirc;ng nhận rằng hệ thống tiện nghi tr&ecirc;n xe chiếm một phần kh&ocirc;ng đ&aacute;ng kể đối với việc ti&ecirc;u hao năng lượng của xe. Thế n&ecirc;n cho rằng điều ho&agrave; khiến pin của xe điện \"tụt như tụt quần\" trong điều kiện kẹt xe l&agrave; phiến diện v&agrave; chưa đ&uacute;ng.<br><br>\r\n<h2 id=\"menuid1\"><strong>2. Nhiệt độ m&ocirc;i trường l&agrave; yếu tố rất quan trọng</strong></h2>\r\n<br><img style=\"height: auto; width: 754px;\" src=\"https://photo2.tinhte.vn/data/attachment-files/2022/08/6089282_Pham-vi-xe-dien-tinhte-6.jpg\" alt=\"Pham-vi-xe-dien-tinhte-6.JPG\" data-width=\"2048\" data-height=\"1365\"><br><br>Michael Nickerson - kỹ sư l&agrave;m việc tại HP trong gần 40 năm, người cũng sử dụng xe điện của Tesla khẳng định việc xe điện c&oacute; tốn pin nhiều hay &iacute;t trong 1 vụ kẹt xe thật sự phụ thuộc v&agrave;o nhiệt độ. Theo &ocirc;ng, nếu thời tiết &ocirc;n ho&agrave;, người l&aacute;i xe kh&ocirc;ng cần d&ugrave;ng tới hệ thống điều ho&agrave; hay m&aacute;y sưởi, mức ti&ecirc;u thụ điện l&agrave; cực thấp, c&oacute; thể chỉ tầm 500 W cho c&aacute;c hệ thống như radio, m&agrave;n h&igrave;nh cảm ứng v&agrave; m&aacute;y t&iacute;nh của xe.<br><br>Khi trời rất lạnh (tầm -18&ordm;C), chiếc Tesla của &ocirc;ng cần 10 kW để chạy hệ thống sưởi. Khi trời rất n&oacute;ng (hơn 38&ordm;C), xe Tesla r&uacute;t khoảng 5 kW để chạy hệ thống m&aacute;y lạnh. Do đ&oacute; trong điều kiện thời tiết khắc nghiệt, xe Tesla c&oacute; thể tốn 5-10 kW pin mỗi tiếng đồng hồ. Con số n&agrave;y đủ để xe c&oacute; thể chạy được 26 - 53 km ở tốc độ b&igrave;nh thường.<br><br>Vậy l&agrave;, d&ugrave; nắng hay d&ugrave; lạnh, th&igrave; pin đều hao hơn, nhưng phải ở mức khắc nghiệt v&agrave; trời lạnh th&igrave; xe tốn pin nhiều hơn trời n&oacute;ng. Ngo&agrave;i việc tốn nhiều năng lượng cho hệ thống sưởi v&agrave;o những h&ocirc;m trời lạnh, bản th&acirc;n cấu tạo pin cũng kh&ocirc;ng ph&ugrave; hợp để hoạt động trong điều kiện như vậy. Chất điện ph&acirc;n được d&ugrave;ng trong pin vốn ở dạng gel hữu cơ v&agrave; khi nhiệt độ c&agrave;ng thấp, d&ograve;ng electron di chuyển c&agrave;ng chậm, khiến cho pin kh&ocirc;ng thể hoạt động theo c&aacute;ch tốt nhất.<br><br>Ở Việt Nam, nắng n&oacute;ng nhất từng ghi nhận l&agrave; tầm 40&ordm;C nhưng trong 1 năm, số ng&agrave;y n&oacute;ng như thế n&agrave;y kh&ocirc;ng nhiều, c&ograve;n lạnh thấp nhất th&igrave; tầm -1&ordm;C nhưng chỉ c&oacute; thể c&oacute; ở những khu vực miền n&uacute;i ph&iacute;a Bắc. Thế n&ecirc;n, t&igrave;nh huống m&agrave; kẹt xe + trời n&oacute;ng tới mức khắc nghiệt sẽ khiến xe hao pin hơn l&agrave; c&oacute; thể xảy ra, nhưng c&oacute; lẽ kh&ocirc;ng nhiều trong thực tế, khi m&agrave; Nhiệt độ trung b&igrave;nh năm v&iacute; dụ ở TP.HCM l&agrave; 27,55&deg;C (th&aacute;ng n&oacute;ng nhất l&agrave; th&aacute;ng 4, nhiệt độ khoảng 29,3&deg;C - 35&deg;C).</div>\r\n</div>\r\n<div>\r\n<div data-author=\"MinhTriND\"><br><br>\r\n<h2 id=\"menuid2\"><strong>3. Xe di chuyển chậm &iacute;t tốn pin hơn v&agrave; hệ thống phanh t&aacute;i sinh kh&ocirc;ng phải v&ocirc; dụng</strong></h2>\r\n<br><img style=\"height: auto; width: 754px;\" src=\"https://photo2.tinhte.vn/data/attachment-files/2022/08/6089283_Pham-vi-xe-dien-tinhte-5.jpg\" alt=\"Pham-vi-xe-dien-tinhte-5.JPG\" data-width=\"2048\" data-height=\"1363\"><br><br>Nhiều người sử dụng xe Tesla cho biết nếu kẹt xe, xe sẽ &iacute;t tốn năng lượng hơn so với l&uacute;c chạy ở tốc độ cao, bởi khi chạy ở tốc độ chậm th&igrave; năng lượng của pin kh&ocirc;ng cần d&ugrave;ng nhiều để chiến đấu với lực ma s&aacute;t lăn v&agrave; gi&oacute;. Giống như xe xăng, xe điện khi chạy nhanh cũng tốn năng lượng nhiều hơn, v&agrave; nếu chạy chậm, pin cũng sẽ r&uacute;t &iacute;t hơn. Người ta cho rằng kẹt xe về cơ bản gi&uacute;p tăng phạm vi hoạt động ở những chiếc xe Tesla, v&agrave; hiệu quả r&otilde; r&agrave;ng nhất khi xe di chuyển trung b&igrave;nh ở vận tốc 30 - 60 km/h.<br><br>Ngo&agrave;i ra, xe điện được cho l&agrave; hiệu quả hơn về mặt năng lượng so với xe xăng trong 1 vụ kẹt xe. Thứ 1 l&agrave; n&oacute; kh&ocirc;ng l&atilde;ng ph&iacute; nhi&ecirc;n liệu khi xe đứng y&ecirc;n. Thứ 2 l&agrave; khi cần nhấn ga để nối đu&ocirc;i xe ph&iacute;a trước sau đ&oacute; ngay lập tức dừng lại, hầu hết năng lượng hao ph&iacute; trong lần tăng tốc đ&oacute; sẽ được thu hồi ngay lập tức bởi hệ thống phanh t&aacute;i sinh - thứ được trang bị hầu hết tr&ecirc;n c&aacute;c xe điện để tạo lực h&atilde;m, đồng thời chuyển động năng, nhiệt năng th&agrave;nh điện năng c&oacute; thể sử dụng.<br><br>\r\n<h2 id=\"menuid3\"><strong>4. C&aacute;c yếu tố kh&aacute;c</strong></h2>\r\n<br><img style=\"height: auto; width: 754px;\" src=\"https://photo2.tinhte.vn/data/attachment-files/2022/08/6089284_Pham-vi-xe-dien-tinhte-3.jpg\" alt=\"Pham-vi-xe-dien-tinhte-3.JPG\" data-width=\"2048\" data-height=\"1363\"><br><br>M&igrave;nh xếp những yếu tố dưới đ&acirc;y v&agrave;o c&ugrave;ng một nh&oacute;m l&agrave; bởi v&igrave; phần lớn trong số ch&uacute;ng đều l&agrave; vấn đề của xe truyền thống chứ kh&ocirc;ng ri&ecirc;ng g&igrave; xe điện. C&aacute;c yếu tố n&agrave;y c&oacute; thể kể tới như tốc độ, điều kiện gi&oacute;, tải trọng tr&ecirc;n xe, &aacute;p suất lốp, ngo&agrave;i ra th&igrave; c&ograve;n c&oacute; yếu tố chai pin nữa. B&ecirc;n cạnh đ&oacute;, điều kiện đường x&aacute; cũng l&agrave; thứ ảnh hưởng lớn đến phạm vi hoạt động của xe điện. Trước đ&acirc;y khi m&igrave;nh chạy xe m&aacute;y điện l&ecirc;n đ&egrave;o, pin hao hụt gần như gấp đ&ocirc;i so với việc đi đường bằng th&ocirc;ng thường.</div>\r\n</div>\r\n<div>\r\n<div data-author=\"MinhTriND\"><br><br>Nắm r&otilde; về c&aacute;c yếu tố t&aacute;c động đến phạm vi vận h&agrave;nh của xe l&agrave; điều cần thiết để lựa chọn xe sao cho ph&ugrave; hợp với nhu cầu bản th&acirc;n, đồng thời tr&aacute;nh c&oacute; những hiểu lầm kh&ocirc;ng đ&uacute;ng về c&aacute;c yếu tố n&agrave;y, bởi đ&ocirc;i khi, ch&uacute;ng kh&ocirc;ng trầm trọng như những lời đồn tr&ecirc;n mạng.</div>\r\n</div>\r\n</div>\r\n</div>\r\n</article>','posts/uwnQpwA9vuQMOmHFauonbGdR8DqUZUPco8LnMyYt.png',2,NULL,17,NULL,'2022-08-28 22:55:39','2022-08-28 23:19:48'),(6,'bbbbbbbbbbbbbbb','bbbbbbbbbbbbbbb','<p>ccccccccccccccccccccccccccccccc</p>','posts/WZ7hc2vGB7lvdJat4TDufp3He72wiwVzjGwblvDu.jpg',3,NULL,13,NULL,'2022-08-28 23:02:52','2022-08-28 23:02:52');
