INSERT INTO `single_types` VALUES (1,'Đơn nghỉ không lương','Sử dụng trong trường hợp nhân viên xin nghỉ không tính công. Mục đích của đơn này là để thông báo cho các bên liên quan về việc nghỉ của nhân viên, nhằm đảm bảo truyền đạt thông tin và tiến độ công việc','Sử dụng trong trường hợp nhân viên xin nghỉ không tính công. Mục đích của đơn này là để thông báo cho các bên liên quan về việc nghỉ của nhân viên, nhằm đảm bảo truyền đạt thông tin và tiến độ công việc.',1,1,1,NULL,'2022-07-29 21:52:35','2022-08-14 20:08:08'),(6,'Đơn khôi phục công','Đơn xin các ngày hiếu hỉ có lương theo quy định của công ty, đơn được tạo trước 1 tuần theo ngày nghỉ','Duyệt đơn qua BM',1,2,1,NULL,'2022-08-01 09:28:42','2022-08-01 09:28:42'),(7,'Đơn làm thêm giờ','Giao diện của mẫu này hiển thị giờ bắt đầu giờ kết thúc làm thêm giờ. Đơn này dùng cho các loại đơn làm thêm giờ, làm thêm giờ vào ngày lễ...','Giao diện của mẫu này hiển thị giờ bắt đầu giờ kết thúc làm thêm giờ. Đơn này dùng cho các loại đơn làm thêm giờ, làm thêm giờ vào ngày lễ...',1,3,1,NULL,'2022-08-03 22:41:52','2022-08-03 22:41:52'),(8,'Đơn sửa chấm công','- Việc xây dựng, thực hiện và duy trì quy trình này nhằm đáp ứng nhu cầu\r\ntrong quá trình ký trong Đại học Y Dược Thành phố Hồ Chí Minh .\r\n- Quy trình được áp dụng đối với các cá nhân, các đơn vị trực thuộc Đại học\r\nY Dược Thành phố Hồ Chí Minh\r\n- Các viên chức, người lao động khi thực hiện trình ký phải tuân theo trình','- Việc xây dựng, thực hiện và duy trì quy trình này nhằm đáp ứng nhu cầu\r\ntrong quá trình ký trong Đại học Y Dược Thành phố Hồ Chí Minh .\r\n- Quy trình được áp dụng đối với các cá nhân, các đơn vị trực thuộc Đại học\r\nY Dược Thành phố Hồ Chí Minh\r\n- Các viên chức, người lao động khi thực hiện trình ký phải tuân theo trình',0,2,1,NULL,'2022-08-09 12:58:53','2022-08-09 12:58:53');
